import './App.css'
import Botao from './Botao';








function App() {

  const Numeros = Array.from({ length: 25 }, (e, i) => i + 1).sort(() => Math.random() - 0.5).filter((e, i) => i < 15);
     function listaNumeros(){
      const listaN = Numeros.map((i) => <div>{i}</div>);
      return listaN
     }   




  return (
    <div className="App">
      <h1>Gerador de jogos da loto fácil</h1>


     <Botao 
     onClick={()=>listaNumeros()}
    >GErar Numeros
     </Botao>

   </div>
  )
}

export default App;
